import React, { Component } from "react";
import "./weather.css";
import "./rainanimtest.css";

class RainAnimTest extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <div className="weather rain"></div>
        <div className="weather rain"></div>
        <div className="weather rain"></div>
      </div>
    );
  }
}

export default RainAnimTest;
